function generateStructureConfig(options) {
    const generateConfigString = options.map(setCfg => {
        const identifyingColumnIds = setCfg.identifyingColumns?.map(attr => attr.id);
        let identifyingString = !setCfg.useObjectId ? `
                  ,"identification": {
        "type": "COLUMN_VALUES",
        "data": {
          "columnIds": [
            ${identifyingColumnIds?.join(',')}
          ]
        }
      }
        ` : `,"identification": {
        "type": "OBJECT_ID"
        }
      `;
        identifyingString = setCfg.strategy === 'INSERT' ? '' : identifyingString;
        return `"${setCfg.DwSet.name}":{
            "setId":${setCfg.DwSet.id},
            "import": {
                "strategy":"${setCfg.strategy}",
                "linkOnlyImported":${setCfg.linkOnlyImported}
                ${identifyingString}
            }
        }`;
    }).join(',');
    const config = `
{
    ${generateConfigString}
}
`;
    let cfgString = 'Could not generate config';
    try {
        cfgString = JSON.stringify(JSON.parse(config), null, 2);
    }
    catch (error) {
        console.log(error);
    }
    return cfgString;
}
